function minimumBeautifulSubstrings(s: string): number {
    let powersOfFive = new Set<string>();
    for (let i = 1; i <= 1 << 20; i *= 5) {
        powersOfFive.add(i.toString(2));
    }

    let dp = new Array(s.length + 1).fill(Number.MAX_SAFE_INTEGER);
    dp[0] = 0;

    for (let i = 1; i <= s.length; i++) {
        for (let j = i; j >= 1; j--) {
            if (s[j - 1] === '0') continue;
            let sub = s.substring(j - 1, i);
            if (powersOfFive.has(sub)) {
                dp[i] = Math.min(dp[i], dp[j - 1] + 1);
            }
        }
    }

    return dp[s.length] === Number.MAX_SAFE_INTEGER ? -1 : dp[s.length];
}
